import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Main } from './pages/Main';
import { useState } from "react";

function App() {
  const [data, setData] = useState({});

  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Main/>}/>
        <Route path='*' element={<Main/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
